  <style>
    .grid {
        display: grid;
        grid-template-columns: 1fr 1fr 1fr 1fr 1fr 1fr;
        grid-template-rows: 2fr 2fr 4fr 4fr 4fr 2fr;
        grid-row-gap: 10px;
        grid-column-gap: 15px;
    }
    
    .header {
      grid-column-start: 1;
      grid-column-end: span 6;
      grid-row-start: 1;
      grid-row-end: span 1;
    }
    
    .navbar brand {
      font-size: 200;
    }
    
    .button1 {
      grid-column-start: 1;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .button2 {
      grid-column-start: 2;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .button3 {
      grid-column-start: 3;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .button4 {
      grid-column-start: 4;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .button5 {
      grid-column-start: 5;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .button6 {
      align-content: center;
      grid-column-start: 6;
      grid-column-end: span 1;
      grid-row-start: 2;
      grid-row-end: span 1;
    }
    
    .leftpicture {
      padding-left: 10px;
      background-color: lightgrey;
      border-radius: 5px;
      border: 2px black solid;
      grid-column-start: 1;
      grid-column-end: span 2;
      grid-row-start: 3;
      grid-row-end: span 3;
    }
    
    .rightarea {
      padding-left: 10px; 
      background-color: lightgrey;
      border-radius: 5px;
      border: 2px black solid;
      grid-column-start: 3;
      grid-column-end: span 4;
      grid-row-start: 3;
      grid-row-end: span 3;
    }
    
  </style>
